export default class User {
    constructor(password, userName, email, phone, birthYear, address,$status,$Confidentiality) {
        this.password = password;
        this.userName = userName;
        this.email = email;
        this.phone = phone;
        this.birthYear = birthYeastatus,Confidentialityr;
        this.address = address;
        this.status = status;
        this.Confidentiality = Confidentiality;
    }
}
